import Vue from 'vue'
import VueRouter from 'vue-router'

const SignIn = () =>
    import ('@/view/SignIn.vue')
const SignUp = () =>
    import ('@/view/SignUp.vue')

Vue.use(VueRouter)

const routes = [{
    path: '/',
    name: 'user',
    redirect: 'user/signin',
    children: [{
            path: 'signup',
            name: 'SignUp',
            component: SignUp,
        },
        {
            path: 'signin',
            name: 'SignIn',
            component: SignIn,
        }
    ]
}]


const router = new VueRouter({
    routes,
    base: process.env.NODE_ENV === 'development' ? '' : '/main',
})

export default router
